function I = fcnK5M(S, T, u, alpha, F, tol)
t1 = F .^ 2;t3 = sqrt(t1 + u);t5 = -alpha + u;t6 = 0.1e1 ./ t5;t7 = t6 .* alpha;t8 = sqrt(-alpha);t9 = F - t8;t10 = t9 .^ 2;t11 = t9 .* t8;t14 = sqrt(t10 + 0.2e1 .* t11 - alpha + u);t15 = 0.1e1 ./ t14;t17 = t8 .* alpha;t18 = t6 .* t17;t20 = 0.1e1 ./ u .* F;t21 = t15 .* t20;t24 = sqrt(t5);t27 = 0.1e1 ./ t24 ./ t5 .* alpha;t30 = 0.1e1 ./ t9;t32 = log(0.2e1 .* t30 .* (t14 .* t24 - alpha + t11 + u));t34 = F + t8;t35 = t34 .^ 2;t36 = t34 .* t8;t39 = sqrt(t35 - 0.2e1 .* t36 - alpha + u);t40 = 0.1e1 ./ t39;t42 = t40 .* t20;t47 = 0.1e1 ./ t34;t49 = log(0.2e1 .* t47 .* (t39 .* t24 - alpha - t36 + u));t55 = alpha .^ 2;t56 = t5 .^ 2;t57 = 0.1e1 ./ t56;t58 = t57 .* t55;t62 = t57 .* t8 .* t55;t67 = 0.1e1 ./ t24 ./ t56 .* t55;t80 = -0.1e1 ./ t3 - t15 .* t7 + 0.3e1 ./ 0.2e1 .* t21 .* t18 + t32 .* t27 - t40 .* t7 - 0.3e1 ./ 0.2e1 .* t42 .* t18 + t49 .* t27 + t15 .* t30 .* t6 .* t17 ./ 0.4e1 - 0.3e1 ./ 0.4e1 .* t15 .* t58 + 0.3e1 ./ 0.4e1 .* t21 .* t62 + 0.3e1 ./ 0.4e1 .* t32 .* t67 - t40 .* t47 .* t6 .* t17 ./ 0.4e1 - 0.3e1 ./ 0.4e1 .* t40 .* t58 - 0.3e1 ./ 0.4e1 .* t42 .* t62 + 0.3e1 ./ 0.4e1 .* t49 .* t67;
I = t80(:,:,2) - t80(:,:,1);

end
